import React from 'react';


export default class Venue extends React.Component {
    render() {
        return (
            <React.Fragment>
                <div className="venue-conatiner">
                    <div className="center-container">
                        <h1>The Venue</h1>
                        <h1><span>Your Stay </span></h1>
                    </div>
                </div>
            </React.Fragment>
        )
    }

}
